import React from "react";
import { Toolbar, AppBar, Typography, CssBaseline } from "@material-ui/core";
import Login from "../components/Login";
import Pomodoro from "../resource/pomodoro.png"; 


function Home() {
  return (
    <div>
      <CssBaseline/>
    <AppBar position="relative">
      <Toolbar>
        <Pomodoro/>
        <Typography variant="h6">
          Tomato Pomodoro
        </Typography>
      </Toolbar>
    </AppBar>
    <main>
      <div>
        <Container maxWidth="sm"><Login/></Container>
      </div>
    </main>
    </div>
  );
}

export default Home;
